import React, {useEffect} from 'react';
import { useNavigate } from "react-router-dom";
import { Button } from 'antd';
import axios from 'axios';


const AdministracionDeCuentasAjustador = () =>{

  const navigate = useNavigate();


  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/Login');
  };


  useEffect(() => {
    const Id = localStorage.getItem('Id_Usuario');
    const token = localStorage.getItem('token');

    const obtenerImagenDeUsuario = async () => {
      try {
        const response = await axios.get(`http://localhost:8000/Ajustadores/ConsultarAjustadoresPorId/${encodeURIComponent(Id)}`, {
          headers: {
            'Authorization': token
          }
        });
        console.log(response);
        console.log("nombres" + response.data.registro.Nombres)
      } catch (error) {
        console.error('Error al obtener la imagen del usuario:', error);
      }
    };
    obtenerImagenDeUsuario(); // Llamar a la función al montar el componente
  }, []);

return(
  <div>Hello
          <Button type="primary" onClick={handleLogout} style={{ marginRight: 16 }}>
        Cerrar Sesión
      </Button>
  </div>
);
}
export default AdministracionDeCuentasAjustador;
